def quantile(self, q=0.5, axis=0, numeric_only=True, interpolation="linear"):
    self._check_percentile(q)

    if numeric_only:
        data = self._get_numeric_data()
    else:
        data = self

    # Check if the DataFrame consists only of datetime data
    if data.select_dtypes(include=[np.datetime64]).shape[1] == len(data.columns):
        q_vals = q if isinstance(q, (list, np.ndarray)) else [q]
        result = pd.concat([data[col].quantile(q=q_vals, interpolation=interpolation) for col in data.columns], axis=1)
        if len(q_vals) == 1:
            result = result.squeeze()
    else:
        axis = self._get_axis_number(axis)
        is_transposed = axis == 1
        if is_transposed:
            data = data.T
        result = data._data.quantile(
            qs=q, axis=1, interpolation=interpolation, transposed=is_transposed
        )
        if result.ndim == 2:
            result = self._constructor(result)
        else:
            result = self._constructor_sliced(result, name=q)
        if is_transposed:
            result = result.T
    return result
